import { 
  Navbar,
  Home,
  Posts, 
} from './components';

const App = () => {

  return <div className="app">
        <Navbar />
        <Home />
        {/* <Posts /> */}
      </div>

}

ReactDOM.render(<HashRouter><App /></HashRouter>, document.getElementById("app"));
